Blockly.Android['print'] = function(block) {
    // Generate JavaScript for moving forward or backwards.
    var print_isLine = block.getFieldValue('print_isLine');
    var print_content = block.getFieldValue('print_content');

    // var print_content_any = block.getFieldValue('print_content_any');这样获取不到拼接块的值
    var print_content_any=Blockly.Android.getThisValue(block,"print_content_any");//获取print_content_any属性值，给到this->block

    if(print_content=='0')
        return '\nSystem.out.'+print_isLine+'("' + print_content_any + '");';
    else
        return '\nSystem.out.'+print_isLine+'("' + print_content + '");';
};

